        console.log(data)
        setPlant(data)
    };
    Response()
    
}, [])
console.log(plant)



const sap=plant.map((x)=>{
    return (
        <div key={x.id}>
            <h3>{x.event}</h3>
        </div>
    )
})


    return  (
        <div><h2>nithiesh</h2>
        {sap}</div>
    )
}

